import React from "react";
import { GoogleMap } from "react-google-maps";

function Map() {
  return (
    <GoogleMap
      defaultZoom={10}
      defaultCenter={{ lat: 59.93848, lng: 30.312481 }}
    />
  );
}

export default function App() {
  return <div> map here </div>;
}
